import React, { Component } from "react";
import "./productListm.css";
import Product from "../product/Product";
import { products } from "../data";

const ProductList = () => {
  return (
    <div className="plm">
      <div className="plm-texts">
        <h1 className="plm-title">
          {" "}
          <br></br> <br></br>Some Photos From Bromo Mountain
        </h1>
        <p className="plm-desc">Lama is a creative portfolio that your work has been waiting for. Beautiful homes, stunning portfolio styles & a whole lot more awaits inside.</p>
      </div>
      <div className="plm-list">
        {products.map((item) => (
          <Product key={item.id} img={item.img} link={item.link} />
        ))}
      </div>
    </div>
  );
};

export default ProductList;
